DROP TABLE IF EXISTS `users_lists`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `users_lists` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint unsigned DEFAULT NULL,
  `title_id` bigint unsigned DEFAULT NULL,
  `list_type_id` bigint unsigned DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `title_id` (`title_id`),
  KEY `user_id` (`user_id`),
  KEY `list_type_id` (`list_type_id`),
  CONSTRAINT `users_lists_ibfk_1` FOREIGN KEY (`title_id`) REFERENCES `titles` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `users_lists_ibfk_2` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `users_lists_ibfk_3` FOREIGN KEY (`list_type_id`) REFERENCES `list_types` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

