/*!50001 VIEW `user_info` AS select `u`.`id` AS `u_id`,concat_ws(' ',`up`.`first_name`,`up`.`last_name`) AS `full_name`,`u`.`nick_name` AS `nickname`,`u`.`email` AS `email`,`c`.`name` AS `name`,`up`.`date_of_birth` AS `date_of_birth`,timestampdiff(YEAR,`up`.`date_of_birth`,now()) AS `age`,(case `up`.`gender` when 'M' then 'male' when 'F' then 'female' when 'ud' then 'undefined' end) AS `gender`,`fa_t`.`c` AS `autors`,`fu_t`.`c` AS `followers`,`fu_f`.`c` AS `following`,`to_w`.`c` AS `to_wish`,`reed`.`c` AS `titles_reed`,`fav`.`c` AS `to_favorit`,`r`.`c` AS `reviews`,`r2`.`c` AS `rated_titles`,`r2`.`avg_rating` AS `avg_rating`,`lk`.`c` AS `likes`,`up`.`about` AS `about` from (((((((((((`users` `u` left join `user_profiles` `up` on((`u`.`id` = `up`.`user_id`))) left join `countries` `c` on((`up`.`country_id` = `c`.`id`))) left join (select count(`follow_autors`.`id`) AS `c`,`follow_autors`.`user_id` AS `user_id` from `follow_autors` group by `follow_autors`.`user_id`) `fa_t` on((`u`.`id` = `fa_t`.`user_id`))) left join (select count(`follow_users`.`id`) AS `c`,`follow_users`.`follower_id` AS `follower_id` from `follow_users` group by `follow_users`.`follower_id`) `fu_t` on((`u`.`id` = `fu_t`.`follower_id`))) left join (select count(`follow_users`.`id`) AS `c`,`follow_users`.`user_id` AS `user_id` from `follow_users` group by `follow_users`.`user_id`) `fu_f` on((`u`.`id` = `fu_f`.`user_id`))) left join (select `ul2`.`user_id` AS `user_id`,count(`ul2`.`title_id`) AS `c` from `users_lists` `ul2` where (`ul2`.`list_type_id` = 3) group by `ul2`.`user_id`) `to_w` on((`u`.`id` = `to_w`.`user_id`))) left join (select `ul2`.`user_id` AS `user_id`,count(`ul2`.`title_id`) AS `c` from `users_lists` `ul2` where (`ul2`.`list_type_id` = 2) group by `ul2`.`user_id`) `reed` on((`u`.`id` = `reed`.`user_id`))) left join (select `ul2`.`user_id` AS `user_id`,count(`ul2`.`title_id`) AS `c` from `users_lists` `ul2` where (`ul2`.`list_type_id` = 1) group by `ul2`.`user_id`) `fav` on((`u`.`id`